INSERT INTO `pages` (`id`, `survey_id`, `name`, `hash`, `type`, `template`, `created_at`, `updated_at`)
VALUES
	(1,3,'intro','','default','<div class=\"wrapper\" id=\"intro\">\r\n	<div id=\"translations\">\r\n		<a href=\"language/en\">English</a> | <a href=\"language/es\">Spanish</a>\r\n	</div><!-- #translations -->\r\n	<h1 class=\"tagline\">Get Paid for Having FUN!!</h1>\r\n	<p>We\'d like your help today by participating in a stock investing game. In this game we\'ll present you with several new product concepts. Once you\'ve reviewed each product concept, you\'ll be given the opportunity to buy shares in them using a stock trading tool.  Dont worry, we wont ask for your money!  Were giving you $1,000 virtual dollars to invest.</p>\r\n	<p>This exercise represents a new way for you to help product designers predict which product will be successful and which will fail. In addition to the reward you\'ll be receiving for participating, by investing in the correct product concept, you\'ll be able to win up to an additional $10!</p>\r\n	<h2 id=\"intro\"></h2>\r\n\r\n\r\n	<div id=\"centerButtons\">\r\n		<a href=\"\" class=\"styledButton navNextButton\">Let\'s Get Started!</a>\r\n	</div>\r\n</div>','2013-12-03 16:31:24','2013-12-05 15:45:05'),
	(2,3,'categories',NULL,'default','<a href=\"#intro\" class=\"prev\"><img src=\"http://intengoresearch.com/img/prev.png\" alt=\"back\"></a>\r\n\r\n<div class=\"wrapper\" id=\"\">\n	<h1>Topic Categories</h1>\r\n	<p>In order to \"win big,\" you\'ll need to make an accurate prediction regarding how people will feel about a particular product concept.  With that in mind, we are testing concepts in the following categories.  Please select the three (3) categories you feel most qualified to evaluate.</p>\r\n	<ul id=\"screenerCategories\" class=\"clearfix\">\r\n	<% _.each(display_categories, function(cat, i) { %>\r\n		<li><input class=\"category_button\" type=\"checkbox\" id=\"<%= cat.id %>\" name=\"<%= cat.name %>\" value=\"<%= cat.id %>\">\r\n			<label for=\"<%= cat.id %>\"><%= cat.name %></label>\r\n		</li>\r\n	<% }); %>\r\n	</ul>\r\n	<div id=\"centerButtons\">\r\n		<a id=\"checkCategories\" href=\"\" class=\"styledButton navNextButton\">Continue</a>\r\n	</div>\r\n</div>','2013-12-03 16:31:25','2013-12-03 16:31:25'),
	(3,3,'agreement','','default','<p><a href=\"#categories\" class=\"prev\"><img src=\"http://intengoresearch.com/img/prev.png\" alt=\"back\"></a></p>\r\n\r\n<div id=\"nda\" align=\"center\">\r\n    <table border=\"0\" align=\"center\" width=\"1015px\" cellpadding=\"0\" cellspacing=\"0\">\r\n    <tbody><tr>\r\n    <td border=\"0\" height=\"11px\"><img src=\"https://surveys.infosurv.com/vovici/images/iCE/theme_01.gif\" border=\"0\"></td>\r\n    </tr>\r\n    <tr>\r\n    <td background=\"https://surveys.infosurv.com/vovici/images/iCE/theme_03.gif\">\r\n    <div style=\"position:relative;margin-left:10px;padding-left:3px;padding-right:2px;width:980px;\">\r\n\r\n              <h1>Intengo</h1>\r\n    <div style=\"font-weight:bold;font-size:1.7em;color:gray;\">Agreement</div>\r\n        <p>This Agreement (the \"Agreement\") is made and entered into by and between Infosurv, Inc. d/b/a Intengo, a Delaware corporation (hereinafter \"Intengo\"), and a participant (hereinafter \"RESPONDENT\") in an online internet study (\"the Study\") being conducted by Intengo (collectively, the \"Parties\").</p>\r\n        <p><strong>WHEREAS</strong>, Intengo desires to share certain confidential information with the RESPONDENT in connection with the Study;</p>\r\n        <p><strong>WHEREAS</strong>, RESPONDENT desires to provide Intengo certain non-confidential information in connection with the Study;</p>\r\n        <p><strong>NOW THEREFORE</strong>, for and in consideration of the foregoing and the mutual promises and covenants contained herein, the Parties agree as follows:</p>\r\n\r\n        <strong>1. DEFINITIONS</strong>\r\n        <ul>\r\n            <li>1.1. \"Confidential Information\" shall mean all non-public information that Intengo provides to RESPONDENT. \"Confidential Information\" shall include, but not be limited to, any images, ideas, descriptions, or media related to the concepts found within the Study.</li>\r\n            <li>1.2. Confidential Information shall not include that information included within the definition of Confidential Information above which:</li>\r\n                <ul>\r\n                    <li>1.2a entered the public domain without RESPONDENT\'s breach of any obligation owed Intengo, or</li>\r\n                    <li>1.2b became known to RESPONDENT prior to Intengo\'s disclosure of such information to RESPONDENT, or</li>\r\n                    <li>1.2c became known to RESPONDENT from a source other than Intengo other than by the breach of an obligation of confidentiality owed to Intengo, or</li>\r\n                    <li>1.2d was independently developed by RESPONDENT.</li>\r\n                </ul>\r\n\r\n            <li>RESPONDENT must establish that information falls into categories 1.2a, 1.2b, 1.2c, or 1.2d with contemporaneous documentary evidence.</li>\r\n            <li>1.3. \"Confidential Materials\" shall mean all tangible materials in any media containing Confidential Information, including without limitation, written or printed documents, product samples, software, machines, prototypes, designs, specifications, articles of manufacture, drawings, and computer disks or tapes, whether machine-readable or user-readable.</li>\r\n        </ul>\r\n\r\n        <strong>2. RESTRICTIONS</strong>\r\n        <ul>\r\n            <li>2.1. RESPONDENT agrees that it will not use the Confidential Information or Confidential Materials for any purpose whatsoever except as necessary for the performance of its duties in connection with the Study.</li>\r\n            <li>2.2. RESPONDENT shall take all reasonable steps necessary to preserve the confidentiality of the Confidential Information and Confidential Materials and to prevent such Confidential Information and Confidential Materials from falling into the public domain or into the possession of other persons, including without limitation those steps that RESPONDENT takes to protect the confidentiality of its own confidential information.</li>\r\n            <li>2.3. RESPONDENT shall not (i) disclose any Confidential Information to any person, or (ii) use the Confidential Information or Confidential Materials for any reason or purpose other than to evaluate said Confidential Materials within the Study.</li>\r\n            <li>2.4. RESPONDENT may not reverse engineer, recreate, reconstruct, deconstruct, decompile, disassemble, or analyze any Confidential Materials or any substantial part thereof, nor create derivative works similar to any Confidential Materials without the express written permission of Intengo. RESPONDENT acknowledges its obligation to control access to technical data under the U.S. Export Laws and Regulations and agrees to adhere to such laws and regulations with regard to any technical data received under this Agreement.</li>\r\n            <li>2.5. RESPONDENT may disclose Confidential Information as required by government or judicial order, provided RESPONDENT gives Intengo prompt notice of such order and complies with any protective order (or equivalent) imposed on such disclosure.</li>\r\n            <li>2.6. RESPONDENT agrees that any and all information provided by RESPONDENT to Intengo in connection with the Study shall be considered non-confidential information by both Parties and such information may be used and/or disclosed by Intengo without restriction.  In addition, both Parties agree that Intengo may transfer any of its rights to use and disclose such information to any third party. Notwithstanding the foregoing, Intengo agrees that it shall not disclose the RESPONDENTS name or residence address to any third party.  RESPONDENT further agrees that all title, ownership rights, and other intellectual and proprietary rights in any an idea or concept embodied in the information provided by RESPONDENT to Intengo shall be the property of Intengo.  If necessary RESPONDENT agrees that it will sign all paperwork required to transfer all title, ownership rights, and other intellectual and proprietary rights in any such idea or concept to Intengo.</li>\r\n        </ul>\r\n\r\n        <strong>3. RIGHTS AND REMEDIES</strong>\r\n        <ul>\r\n            <li>3.1. RESPONDENT shall notify Intengo promptly upon discovery of any unauthorized use or disclosure of Confidential Information or Confidential Materials, or any other breach of this Agreement by RESPONDENT, and will cooperate with Intengo in every reasonable way to help Intengo regain possession of the Confidential Information or Confidential Materials and prevent its future unauthorized use.</li>\r\n            <li>3.2. RESPONDENT shall return all originals, copies, reproductions, and summaries of Confidential Information and Confidential Materials at Intengo\'s request or, at Intengo\'s option, certify destruction of the same.</li>\r\n            <li>3.3. RESPONDENT acknowledges that monetary damages may not be a sufficient remedy for unauthorized disclosure or use of Confidential Information or Confidential Materials and that Intengo shall be entitle to, without waiving any other rights or remedies, such injunctive or equitable relief as may deemed proper by a court of competent jurisdiction.</li>\r\n        </ul>\r\n\r\n        <strong>4. MISCELLANEOUS</strong>\r\n        <ul>\r\n            <li>4.1. All Confidential Information and Confidential Materials are and shall remain the property of Intengo. By disclosing information to RESPONDENT, Intengo does not grant any express or implied right or license to RESPONDENT to use the Confidential Information and Confidential Materials or to any of Intengo\'s patents, copyrights, trademarks, trade secret information or other intellectual property.</li>\r\n            <li>4.2. This Agreement constitutes the entire agreement between the Parties with respect to the subject matter hereof and merges all prior discussions between them regarding the Confidential Information and Confidential Materials. This Agreement shall not be modified except by a written agreement dated subsequent to the date of this Agreement and signed by both Parties. None of the provisions of this Agreement shall be deemed to have been waived by any act or acquiescence on the part of Intengo, its agents, or employees, but only by an instrument in writing signed by an authorized officer of Intengo. No waiver of any provision of this Agreement shall constitute a waiver of any other provision(s) or of the same provision on another occasion.</li>\r\n            <li>4.3. If Intengo employs attorneys to enforce any rights arising out of or in relation to this Agreement, and prevails in such matter, Intengo shall be entitled to recover reasonable attorney\'s fees. This Agreement shall be construed and controlled by the laws of the State of Georgia, and both Parties consent to jurisdiction by the state and federal courts sitting in the State of Georgia. Process may be served on either party by U.S. Mail, postage prepaid, certified or registered, return receipt requested. If any provision of this Agreement shall be held by a court of competent jurisdiction to be illegal, invalid or unenforceable, the remaining provisions shall remain in full force and effect.</li>\r\n            <li>4.4. This Agreement will inure to the benefit of and be binding upon the Parties, their successors and assigns. All obligations created by this Agreement shall survive termination of the Parties\' business relationship.</li>\r\n        </ul>\r\n\r\n    <br>\r\n    <table cellspacing=\"0\" cellpadding=\"0\" width=\"900\" border=\"0\" class=\"copyright-text\">\r\n    <tbody>\r\n    <tr>\r\n    <td align=\"left\" width=\"33%\"></td>\r\n    <td align=\"center\" width=\"33%\"><span class=\"copyright-text\"><font color=\"#777777\"> 2013 Intengo. (Infosurv, Inc. d/b/a Intengo). All rights reserved.</font></span></td>\r\n    <td align=\"right\" width=\"34%\"></td></tr></tbody></table>\r\n    </div>\r\n    </td></tr>\r\n    <tr>\r\n    <td><img src=\"https://surveys.infosurv.com/vovici/images/iCE/theme_05.gif\"></td></tr></tbody></table>\r\n</div>\r\n\r\n<div class=\"wrapper\" id=\"\">\r\n    <h1>Agreement</h1>\r\n    <p>A major U.S. manufacturer of laundry care products would like your feedback! But before we begin, we need you to recognize that the concepts you are about to review are the confidential, intellectual property of our client. In order to proceed, you must agree to the terms of our <a href=\"#nda\" class=\"fancybox\">NDA (non-disclosure agreement)</a> which specifies how you must treat this confidential information.</p>\r\n\r\n    <ul id=\"agreementPage\">\r\n        <li><a href=\"#thank_you_fail\" class=\"styledButton do-not-agree\">I Do Not Agree</a></li>\r\n        <li><a href=\"\" class=\"styledButton agree navNextButton\">I Agree</a></li>\r\n    </ul>\r\n</div>','2013-12-03 16:31:25','2013-12-05 15:35:10'),
	(4,3,'background',NULL,'default','<a href=\"#agreement\" class=\"prev\"><img src=\"http://intengoresearch.com/img/prev.png\" alt=\"back\"></a>\r\n\r\n	<div class=\"wrapper\" id=\"\">\n		<h1>Background</h1>\r\n		<p>\r\n			First things first.  We need you to get inside the mind of this companys primary customer. In this case, a woman between the ages of 28 and 52 who makes decisions regarding laundry care for her family. Today youll be predicting which new product concept this customer is most likely to buy if it becomes available for purchase.\r\n		</p>\r\n\r\n		<p>\r\n			If you predict the right one, you can earn up to an additional $10!\r\n		</p>\r\n\r\n		<div id=\"centerButtons\">\r\n			<a href=\"\" class=\"styledButton navNextButton\">Continue</a>\r\n		</div>\r\n	</div>','2013-12-03 16:31:25','2013-12-03 16:31:25'),
	(5,3,'instructions','','default','<a href=\"#instructions\" class=\"prev\"><img src=\"http://intengoresearch.com/img/prev.png\" alt=\"back\"></a>\r\n\r\n	<div class=\"wrapper\" id=\"instructions\">\r\n		<h1>Instructions</h1>\r\n		<p>\r\n			To make your predictions, youll be asked to invest $1,000 virtual dollars among the available concepts.\r\n		</p>\r\n\r\n		<p>\r\n			On the next page, were going to show you the first concept.  If you think youd like to buy shares in this concept, just click Add to Portfolio. If you dont think the concept will be successful, just click No Thanks.\r\n		</p>\r\n		<p>\r\n			Once youve chosen all of the concepts youd like to buy shares in, well tell you the cost of each concepts shares and then let you decide how youd like to invest. You can always remove concepts from your portfolio if you decide not to purchase shares.\r\n		</p>\r\n\r\n		<div id=\"centerButtons\">\r\n			<a href=\"\" class=\"styledButton navNextButton\">Show me the Concepts</a>\r\n		</div>\r\n	</div>','2013-12-03 16:31:25','2013-12-05 15:37:14'),
	(6,3,'concept',NULL,'default','<a href=\"#instructions\" class=\"prev\"><img src=\"http://intengoresearch.com/img/prev.png\" alt=\"back\"></a>\r\n\r\n	<div class=\"wrapper\" id=\"conceptsPage\">\n		<h1><%= this.model.get(\'name\') %></h1>\r\n\r\n		<div id=\"conceptHTML\">\r\n			<%= this.model.get(\'html\') %>\r\n\r\n			<div id=\"portfolioButtons\">\r\n				<div style=\"display:inline;margin:0px 10px;\">\r\n					<a href=\"#next\" data-concept_id=\"<%= this.model.get(\'id\') %>\" class=\"styledButton reject\">No Thanks</a>\r\n				</div>\r\n\r\n				<div style=\"display:inline;margin:0px 10px;\">\r\n					<a href=\"#next\" class=\"styledButton add\" data-concept_id=\"<%= this.model.get(\'id\') %>\">Add To Portfolio</a>\r\n				</div>\r\n			</div>\r\n		</div>\r\n	</div>','2013-12-03 16:31:25','2013-12-03 16:31:25'),
	(7,3,'buy','','default','<div class=\"wrapper\" id=\"buy\">\r\n		<h1>Your Concepts</h1>\r\n		<p>Alright, it\'s time to check out. Below, you\'ll see the logos you have selected and their current share price. You have $1,000 virtual dollars to invest in shares. If you buy shares in the logo <strong>that correctly answers the following question</strong>, those shares will be converted to real money (USD)!</p>\r\n\r\n		<div class=\'concept-question\'>Which concept is most likely to be purchased by women aged 28-52?</div>\r\n\r\n		<form action=\"\">\r\n			<table width=\"100%\" id=\"market\">\r\n				<tr>\r\n					<th class=\'removeFromCart\'></th>\r\n					<th>Concept Name</th>\r\n					<th id=\"priceth\">Current Price</th>\r\n					<th id=\"ati\" colspan=\"2\" >Amount to Invest</th>\r\n					<th id=\"pic\">Payout if Correct</th>\r\n				</tr>\r\n				<%\r\n					concepts.each(function(concept, idx){\r\n				%>\r\n					<tr class=\'<%= (idx % 2 == 0) ? \"even\" : \"odd\" %> concept\' id=\"concept_<%= idx %>\" data-id=\"<%= concept.get(\'id\') %>\">\r\n						<td class=\'removeFromCart\'><a href=\"#removeFromCart\" class=\"remove\"></a></td>\r\n						<td class=\"conceptName\" data-id=\"<%= concept.get(\'id\') %>\">\r\n							<a href=\"#<%= concept.get(\'id\') %>\" class=\"inline\"><%= concept.get(\'name\') %></a>\r\n						</td>\r\n						<td class=\'price\'>$<%= concept.get(\'marketPrice\') %></td>\r\n						<td class=\"atislider\">\r\n							<input type=\"range\" class=\"stock_selection\" id=\"stock_<%= idx %>\" value=\'0\' min=\'0\' max=\'1000\' step=\"1\">\r\n						</td>\r\n						<td class=\"amountToInvest\">$<input class=\"ati\" type=\"text\" value=\"0\"></td>\r\n\r\n						<td class=\'payout\'>$0.00</td>\r\n					</tr>\r\n				<% }); %>\r\n			</table>\r\n		</form>\r\n\r\n		<div id=\"balanceWrapper\">\r\n			Remaining Balance: <span id=\"remainingBalance\">$1000.00</span>\r\n		</div>\r\n\r\n		<div id=\"buyFooter\">\r\n			<a href=\"#concept/0\" class=\"styledButton reset\">Reset</a>\r\n			<a href=\"\" class=\"styledButton purchase navNextButton\">Purchase</a>\r\n		</div>\r\n		\r\n		<div class=\"popups hidden\">\r\n			<% concepts.each(function(concept, idx){ %>\r\n				<div id=\"<%= concept.get(\'id\') %>\">\r\n					<h4><%= concept.get(\'name\') %></h4>\r\n					<p><%= concept.get(\'thumb_html\') %></p>\r\n				</div>\r\n			<% }); %>\r\n		</div>\r\n</div>','2013-12-03 16:31:25','2013-12-05 15:39:09'),
	(8,3,'best_concept','','default','<a href=\"\" class=\"next navNextButton\"><img src=\"http://intengoresearch.com/img/next.png\" alt=\"next\"></a>\r\n\r\n<div class=\"wrapper\" id=\"best_concept\">\r\n	<h1 id=\"notietitle\">Best Concept</h1>\r\n	<h1 id=\"tietitle\" style=\"display:none;\">Best Concept</h1>\r\n	<section id=\"tie\">\r\n		<p>If we were to offer you 10 additional shares in <strong>one</strong> of the following concepts, which would you choose?</p>\r\n		<div id=\"concepts\"></div>\r\n	</section>\r\n\r\n	<section id=\"winner\">\r\n		<div id=\"concept\"></div>\r\n		<div id=\"questions\"></div>\r\n	</section>\r\n	</div>','2013-12-03 16:31:25','2013-12-05 15:40:31'),
	(9,3,'worst_concept',NULL,'default','<a href=\"#best_concept\" class=\"prev\"><img src=\"http://intengoresearch.com/img/prev.png\" alt=\"back\"></a>\r\n\r\n	\r\n<a href=\"\" class=\"next navNextButton\"><img src=\"http://intengoresearch.com/img/next.png\" alt=\"next\"></a>\r\n<div class=\"wrapper\" id=\"worst_concept\">\n	<h1 id=\"notietitle\">Worst Concept</h1>\r\n	<h1 id=\"tietitle\" style=\"display:none;\">Worst Concept Tie</h1>\r\n	<section id=\"tie\">\r\n		<p>You decided not to purchase shares in the following <strong>concepts</strong>. However, imagine you owned ten (10) shares in each. If you were forced to <strong>sell all of your shares</strong> in one of these <strong>concepts</strong>, which would you choose.</p>\r\n		<div id=\"concepts\"></div>\r\n	</section>\r\n\r\n	<section id=\"winner\" class=\"result\">\r\n		<div id=\"concept\"></div>\r\n		<div id=\"questions\"></div>\r\n	</section>\r\n	</div>','2013-12-03 16:31:25','2013-12-03 16:31:25'),
	(10,3,'suggestions',NULL,'default','<a href=\"#worst_concept\" class=\"prev\"><img src=\"http://intengoresearch.com/img/prev.png\" alt=\"back\"></a>\r\n\r\n	\r\n<a href=\"\" class=\"next navNextButton\"><img src=\"http://intengoresearch.com/img/next.png\" alt=\"next\"></a>\r\n<div class=\"wrapper\" id=\"suggestions\">\n	<h1>Help Improve These Products!</h1>\r\n	<section>\r\n		<div id=\"concepts\"></div>\r\n		<div id=\"votes\">\r\n			<p style=\"margin-top:0px;\">\r\n				Here are some suggestions for improving this product. Use the \"thumbs up\" or \"thumbs down\" buttons to indicate if you agree with the suggestion. You can also add a suggestion of your own using the space provided at the bottom.\r\n			</p>\r\n\r\n			<b>If you could change one thing about this concept to make it more appealing to women aged 28-52, what would that be?</b>\r\n			<div id=\"suggestions_wrapper\"></div>\r\n\r\n		</div>\r\n	</section>\r\n	</div>','2013-12-03 16:31:25','2013-12-03 16:31:25'),
	(11,3,'demographics',NULL,'default','<a href=\"#suggestions\" class=\"prev\"><img src=\"http://intengoresearch.com/img/prev.png\" alt=\"back\"></a>\r\n\r\n	\r\n<a href=\"\"  class=\"next navNextButton\"><img src=\"http://intengoresearch.com/img/next.png\" alt=\"next\"></a>\r\n\r\n<div class=\"wrapper\" id=\"demographics\">\n	<h1>Tell us a little about yourself.</h1>\r\n\r\n	<section>\r\n		<p></p>\r\n		<ul id=\"questions\"></ul>\r\n	</section>\r\n	</div>','2013-12-03 16:31:25','2013-12-03 16:31:25'),
	(12,3,'finish',NULL,'default','<div class=\"wrapper\" id=\"finish\">\n	<h1>Thank you for participating.</h1>\r\n	<p>\r\n		Thanks for taking the time to give us your feedback...\r\n	</p>\r\n	</div>','2013-12-03 16:31:25','2013-12-03 16:31:25'),
	(13,3,'buy_fail',NULL,'optional','<div class=\"wrapper\" id=\"buy_fail\">\n	<h1>Uh oh!</h1>\r\n	<p>You must add at least one concept to your portfolio. Please click the button below to try again.</p>\r\n\r\n	<div id=\"centerButtons\">\r\n			<a href=\"#concept/0\" class=\"styledButton reset\">Try Again</a>\r\n	</div>\r\n	</div>','2013-12-03 16:31:25','2013-12-03 16:31:25'),
	(14,3,'category_fail',NULL,'optional','<div class=\"wrapper\" id=\"category_fail\">\n	<h1>Thank you for participating.</h1>\r\n	<p>\r\n		Thanks for your interest in our research.  Unfortunately, your expertise isn\'t a great match for our current prediction challenges.  But we\'re launching new studies every week, so be on the lookout for another opportunity soon!\r\n	</p>\r\n	</div>','2013-12-03 16:31:25','2013-12-03 16:31:25'),
	(15,3,'thank_you_fail',NULL,'optional','<div class=\"wrapper\" id=\"thank_you_fail\">\n\r\n		<h1>Thank you for participating.</h1>\r\n		<p>\r\n		       Unfortunately you arent good enough, dont meet our criteria, and therefore fail at life.\r\n		       Oh and .... Curabitur vulputate, ligula lacinia scelerisque tempor, lacus lacus ornare ante,\r\n		       ac egestas est urna sit amet arcu. Class aptent taciti sociosqu ad litora torquent per. Curabitur\r\n		       vulputate, ligula lacinia scelerisque tempor, lacus lacus ornare ante, ac egestas est urna sit amet arcu. Class aptent taciti sociosqu ad litora torquent per.\r\n		</p>\r\n	</div>','2013-12-03 16:31:25','2013-12-03 16:31:25'),
	(16,3,'quota_met',NULL,'optional','<div class=\"wrapper\" id=\"quota_met\">\n	<h1>Uh oh!</h1>\r\n	<p>This survey has already been completed by the maximum number of participants. Thank you for your interest!</p>\r\n\r\n\r\n	</div>','2013-12-03 16:31:25','2013-12-03 16:31:25'),
	(17,4,'intro','','default','<div class=\"wrapper\" id=\"intro\">\r\n	<div id=\"translations\">\r\n		<a href=\"language/en\">English</a> | <a href=\"language/es\">Spanish</a>\r\n	</div><!-- #translations -->\r\n	<h1 class=\"tagline\">Get Paid for Having FUN!!</h1>\r\n	<p>We\'d like your help today by participating in a stock investing game. In this game we\'ll present you with several new design concepts. Once you\'ve reviewed each concept, you\'ll be given the opportunity to buy shares in them using a stock trading tool. Dont worry, we wont ask for your money! Were giving you $1,000 virtual dollars to invest.</p>\r\n	<p>This exercise represents a new way for you to help companies predict which designs will intrigue people and which will make no impact. In addition to the reward you\'ll be receiving for participating, by investing in the correct concept, you\'ll be able to win up to an additional $10!</p>\r\n	<h2 id=\"intro\"></h2>\r\n\r\n\r\n	<div id=\"centerButtons\">\r\n		<a href=\"\" class=\"styledButton navNextButton\">Let\'s Get Started!</a>\r\n	</div>\r\n</div>','2013-12-03 16:31:24','2013-12-03 22:18:55'),
	(18,4,'categories','','default','<a href=\"#intro\" class=\"prev\"><img src=\"http://intengoresearch.com/img/prev.png\" alt=\"back\"></a>\r\n\r\n<div class=\"wrapper\" id=\"\">\r\n	<h1>Who Do You Know?</h1>\r\n	<p>For this exercise, youll need to get inside the mind of a specific type of person.  Youll need to understand this persons motivations, preferences, and attitudes in order to make the best prediction.  And remember, youll only earn a bonus by choosing the correct concept, so only choose the three (3) types of people you are most familiar with:</p>\r\n\r\n	<ul id=\"screenerCategories\" class=\"clearfix\">\r\n	<% _.each(display_categories, function(cat, i) { %>\r\n		<li><input class=\"category_button\" type=\"checkbox\" id=\"<%= cat.id %>\" name=\"<%= cat.name %>\" value=\"<%= cat.id %>\">\r\n			<label for=\"<%= cat.id %>\"><%= cat.name %></label>\r\n		</li>\r\n	<% }); %>\r\n	</ul>\r\n	<div id=\"centerButtons\">\r\n		<a id=\"checkCategories\" href=\"\" class=\"styledButton navNextButton\">Continue</a>\r\n	</div>\r\n</div>','2013-12-03 16:31:25','2013-12-03 16:53:57'),
	(19,4,'agreement','','default','<a href=\"#categories\" class=\"prev\"><img src=\"http://intengoresearch.com/img/prev.png\" alt=\"back\"></a>\r\n\r\n<div id=\"nda\" align=\"center\">\r\n	<table border=\"0\" align=\"center\" width=\"1015px\" cellpadding=\"0\" cellspacing=\"0\">\r\n	<tbody><tr>\r\n	<td border=\"0\" height=\"11px\"><img src=\"https://surveys.infosurv.com/vovici/images/iCE/theme_01.gif\" border=\"0\"></td>\r\n	</tr>\r\n	<tr>\r\n	<td background=\"https://surveys.infosurv.com/vovici/images/iCE/theme_03.gif\">\r\n	<div style=\"position:relative;margin-left:10px;padding-left:3px;padding-right:2px;width:980px;\">\r\n\r\n	          <h1>Intengo</h1>\r\n	<div style=\"font-weight:bold;font-size:1.7em;color:gray;\">Agreement</div>\r\n		<p>This Agreement (the \"Agreement\") is made and entered into by and between Infosurv, Inc. d/b/a Intengo, a Delaware corporation (hereinafter \"Intengo\"), and a participant (hereinafter \"RESPONDENT\") in an online internet study (\"the Study\") being conducted by Intengo (collectively, the \"Parties\").</p>\r\n		<p><strong>WHEREAS</strong>, Intengo desires to share certain confidential information with the RESPONDENT in connection with the Study;</p>\r\n		<p><strong>WHEREAS</strong>, RESPONDENT desires to provide Intengo certain non-confidential information in connection with the Study;</p>\r\n		<p><strong>NOW THEREFORE</strong>, for and in consideration of the foregoing and the mutual promises and covenants contained herein, the Parties agree as follows:</p>\r\n\r\n		<strong>1. DEFINITIONS</strong>\r\n		<ul>\r\n			<li>1.1. \"Confidential Information\" shall mean all non-public information that Intengo provides to RESPONDENT. \"Confidential Information\" shall include, but not be limited to, any images, ideas, descriptions, or media related to the concepts found within the Study.</li>\r\n			<li>1.2. Confidential Information shall not include that information included within the definition of Confidential Information above which:</li>\r\n				<ul>\r\n					<li>1.2a entered the public domain without RESPONDENT\'s breach of any obligation owed Intengo, or</li>\r\n					<li>1.2b became known to RESPONDENT prior to Intengo\'s disclosure of such information to RESPONDENT, or</li>\r\n					<li>1.2c became known to RESPONDENT from a source other than Intengo other than by the breach of an obligation of confidentiality owed to Intengo, or</li>\r\n					<li>1.2d was independently developed by RESPONDENT.</li>\r\n				</ul>\r\n\r\n			<li>RESPONDENT must establish that information falls into categories 1.2a, 1.2b, 1.2c, or 1.2d with contemporaneous documentary evidence.</li>\r\n			<li>1.3. \"Confidential Materials\" shall mean all tangible materials in any media containing Confidential Information, including without limitation, written or printed documents, product samples, software, machines, prototypes, designs, specifications, articles of manufacture, drawings, and computer disks or tapes, whether machine-readable or user-readable.</li>\r\n		</ul>\r\n\r\n		<strong>2. RESTRICTIONS</strong>\r\n		<ul>\r\n			<li>2.1. RESPONDENT agrees that it will not use the Confidential Information or Confidential Materials for any purpose whatsoever except as necessary for the performance of its duties in connection with the Study.</li>\r\n			<li>2.2. RESPONDENT shall take all reasonable steps necessary to preserve the confidentiality of the Confidential Information and Confidential Materials and to prevent such Confidential Information and Confidential Materials from falling into the public domain or into the possession of other persons, including without limitation those steps that RESPONDENT takes to protect the confidentiality of its own confidential information.</li>\r\n			<li>2.3. RESPONDENT shall not (i) disclose any Confidential Information to any person, or (ii) use the Confidential Information or Confidential Materials for any reason or purpose other than to evaluate said Confidential Materials within the Study.</li>\r\n			<li>2.4. RESPONDENT may not reverse engineer, recreate, reconstruct, deconstruct, decompile, disassemble, or analyze any Confidential Materials or any substantial part thereof, nor create derivative works similar to any Confidential Materials without the express written permission of Intengo. RESPONDENT acknowledges its obligation to control access to technical data under the U.S. Export Laws and Regulations and agrees to adhere to such laws and regulations with regard to any technical data received under this Agreement.</li>\r\n			<li>2.5. RESPONDENT may disclose Confidential Information as required by government or judicial order, provided RESPONDENT gives Intengo prompt notice of such order and complies with any protective order (or equivalent) imposed on such disclosure.</li>\r\n			<li>2.6. RESPONDENT agrees that any and all information provided by RESPONDENT to Intengo in connection with the Study shall be considered non-confidential information by both Parties and such information may be used and/or disclosed by Intengo without restriction.  In addition, both Parties agree that Intengo may transfer any of its rights to use and disclose such information to any third party. Notwithstanding the foregoing, Intengo agrees that it shall not disclose the RESPONDENTS name or residence address to any third party.  RESPONDENT further agrees that all title, ownership rights, and other intellectual and proprietary rights in any an idea or concept embodied in the information provided by RESPONDENT to Intengo shall be the property of Intengo.  If necessary RESPONDENT agrees that it will sign all paperwork required to transfer all title, ownership rights, and other intellectual and proprietary rights in any such idea or concept to Intengo.</li>\r\n		</ul>\r\n\r\n		<strong>3. RIGHTS AND REMEDIES</strong>\r\n		<ul>\r\n			<li>3.1. RESPONDENT shall notify Intengo promptly upon discovery of any unauthorized use or disclosure of Confidential Information or Confidential Materials, or any other breach of this Agreement by RESPONDENT, and will cooperate with Intengo in every reasonable way to help Intengo regain possession of the Confidential Information or Confidential Materials and prevent its future unauthorized use.</li>\r\n			<li>3.2. RESPONDENT shall return all originals, copies, reproductions, and summaries of Confidential Information and Confidential Materials at Intengo\'s request or, at Intengo\'s option, certify destruction of the same.</li>\r\n			<li>3.3. RESPONDENT acknowledges that monetary damages may not be a sufficient remedy for unauthorized disclosure or use of Confidential Information or Confidential Materials and that Intengo shall be entitle to, without waiving any other rights or remedies, such injunctive or equitable relief as may deemed proper by a court of competent jurisdiction.</li>\r\n		</ul>\r\n\r\n		<strong>4. MISCELLANEOUS</strong>\r\n		<ul>\r\n			<li>4.1. All Confidential Information and Confidential Materials are and shall remain the property of Intengo. By disclosing information to RESPONDENT, Intengo does not grant any express or implied right or license to RESPONDENT to use the Confidential Information and Confidential Materials or to any of Intengo\'s patents, copyrights, trademarks, trade secret information or other intellectual property.</li>\r\n			<li>4.2. This Agreement constitutes the entire agreement between the Parties with respect to the subject matter hereof and merges all prior discussions between them regarding the Confidential Information and Confidential Materials. This Agreement shall not be modified except by a written agreement dated subsequent to the date of this Agreement and signed by both Parties. None of the provisions of this Agreement shall be deemed to have been waived by any act or acquiescence on the part of Intengo, its agents, or employees, but only by an instrument in writing signed by an authorized officer of Intengo. No waiver of any provision of this Agreement shall constitute a waiver of any other provision(s) or of the same provision on another occasion.</li>\r\n			<li>4.3. If Intengo employs attorneys to enforce any rights arising out of or in relation to this Agreement, and prevails in such matter, Intengo shall be entitled to recover reasonable attorney\'s fees. This Agreement shall be construed and controlled by the laws of the State of Georgia, and both Parties consent to jurisdiction by the state and federal courts sitting in the State of Georgia. Process may be served on either party by U.S. Mail, postage prepaid, certified or registered, return receipt requested. If any provision of this Agreement shall be held by a court of competent jurisdiction to be illegal, invalid or unenforceable, the remaining provisions shall remain in full force and effect.</li>\r\n			<li>4.4. This Agreement will inure to the benefit of and be binding upon the Parties, their successors and assigns. All obligations created by this Agreement shall survive termination of the Parties\' business relationship.</li>\r\n		</ul>\r\n\r\n	<br>\r\n	<table cellspacing=\"0\" cellpadding=\"0\" width=\"900\" border=\"0\" class=\"copyright-text\">\r\n	<tbody>\r\n	<tr>\r\n	<td align=\"left\" width=\"33%\"></td>\r\n	<td align=\"center\" width=\"33%\"><span class=\"copyright-text\"><font color=\"#777777\"> 2013 Intengo. (Infosurv, Inc. d/b/a Intengo). All rights reserved.</font></span></td>\r\n	<td align=\"right\" width=\"34%\"></td></tr></tbody></table>\r\n	</div>\r\n	</td></tr>\r\n	<tr>\r\n	<td><img src=\"https://surveys.infosurv.com/vovici/images/iCE/theme_05.gif\"></td></tr></tbody></table>\r\n</div>\r\n\r\n<div class=\"wrapper\" id=\"\">\r\n	<h1>Agreement</h1>\r\n	<p>A new educational based and career planning company would like your feedback! <strong>Your job is to predict which logo is most likely to capture the attention of Millennials who are looking to find information and career insights on opportunities within a particular industry (primarily ages 18-24)</strong>. If you predict the right one, you can earn up to an additional $10!</p>\r\n\r\n<p>For this scenario you will be reviewing 3 logo concepts. The concepts you are about to review are the confidential intellectual property of our client. In order to proceed, you must agree to the terms of our <a href=\"#nda\" class=\"fancybox\">NDA (non-disclosure agreement)</a>, which specifies how you must treat this confidential information.</p>\r\n\r\n	<ul id=\"agreementPage\">\r\n		<li><a href=\"#thank_you_fail\" class=\"styledButton do-not-agree\">I Do Not Agree</a></li>\r\n		<li><a href=\"\" class=\"styledButton agree navNextButton\">I Agree</a></li>\r\n	</ul>\r\n</div>','2013-12-03 16:31:25','2013-12-03 17:06:26'),
	(20,4,'background','','default','<a href=\"#agreement\" class=\"prev\"><img src=\"http://intengoresearch.com/img/prev.png\" alt=\"back\"></a>\r\n\r\n<div class=\"wrapper\" id=\"\">\r\n	<h1>Background</h1>\r\n	<p>Before we show you the logo concepts, we want to tell you a bit about what this company stands for and the type of \r\n	person they are trying to attract.</p>\r\n\r\n	<h4 class=\"underline\">The Challenge</h4>\r\n	<p>We have been asked to select a logo for a business that wants to launch a targeted service offering that aspires to become the go-to resource for insights, career pathing, and general education on opportunities in the insurance industry.  The logo should be exciting and inviting  to motivate people to want to be a part of the insurance industry.</p>\r\n\r\n	<h4 class=\"underline\">Who We Want to Attract</h4>\r\n	<p>The logo should most importantly capture the attention of Millennials who are starting out their careers (primarily ages 18-24).  It should inspire them to want to learn more about potential opportunities available within the insurance field, how their interests and skills could translate to various positions/roles, and to change their perception of the industry overall in a favorable way.</p>\r\n\r\n	<p>Remember, Millennials are tech savvy and entrepreneurial.  They are well-educated, diverse, non-conformists, confident and accepting.  With social media ever-present, they are well-connected.  They believe that hard work should feel good, meaning they believe in it.  And they are self-advocates, believing they can have what they want if they work hard.</p>\r\n\r\n	<p>You should only invest in logos that will intrigue these people.</p>\r\n\r\n	<div id=\"centerButtons\">\r\n		<a href=\"\" class=\"styledButton navNextButton\">Continue</a>\r\n	</div>\r\n</div>','2013-12-03 16:31:25','2013-12-04 15:54:41'),
	(21,4,'instructions','','default','<a href=\"#instructions\" class=\"prev\"><img src=\"http://intengoresearch.com/img/prev.png\" alt=\"back\"></a>\r\n\r\n	<div class=\"wrapper\" id=\"instructions\">\r\n		<h1>Instructions</h1>\r\n		<p>\r\n			Now, thinking about what this company stands for, and the people they plan to serve, were going to show you a few potential logo concepts for the company. As you make your predictions regarding the strongest concept(s), think carefully about the companys purpose, and the personality of the people theyd like to attract.</p>\r\n\r\n<p>To make your predictions, youll be asked to invest $1,000 virtual dollars among the available concepts. Think of it as making a bet or investing in the stock market.</p>\r\n\r\n<p>On the next page, were going to show you the first concept. If you think youd like to buy shares in this concept, just click Add to Portfolio. If you dont think the concept will be successful, just click No Thanks.</p>\r\n\r\n<p>Once youve chosen all of the concepts youd like to buy shares in, well tell you the cost of each concepts shares and then let you decide how youd like to invest. You can always remove concepts from your portfolio if you decide not to purchase shares.</p>\r\n\r\n		<div id=\"centerButtons\">\r\n			<a href=\"\" class=\"styledButton navNextButton\">Show me the Concepts</a>\r\n		</div>\r\n	</div>','2013-12-03 16:31:25','2013-12-04 15:56:43'),
	(22,4,'concept',NULL,'default','<a href=\"#instructions\" class=\"prev\"><img src=\"http://intengoresearch.com/img/prev.png\" alt=\"back\"></a>\r\n\r\n	<div class=\"wrapper\" id=\"conceptsPage\">\n		<h1><%= this.model.get(\'name\') %></h1>\r\n\r\n		<div id=\"conceptHTML\">\r\n			<%= this.model.get(\'html\') %>\r\n\r\n			<div id=\"portfolioButtons\">\r\n				<div style=\"display:inline;margin:0px 10px;\">\r\n					<a href=\"#next\" data-concept_id=\"<%= this.model.get(\'id\') %>\" class=\"styledButton reject\">No Thanks</a>\r\n				</div>\r\n\r\n				<div style=\"display:inline;margin:0px 10px;\">\r\n					<a href=\"#next\" class=\"styledButton add\" data-concept_id=\"<%= this.model.get(\'id\') %>\">Add To Portfolio</a>\r\n				</div>\r\n			</div>\r\n		</div>\r\n	</div>','2013-12-03 16:31:25','2013-12-03 16:31:25'),
	(23,4,'buy','','default','<div class=\"wrapper\" id=\"buy\">\r\n		<h1>Your Logos</h1>\r\n		<p>Alright, it\'s time to check out. Below, you\'ll see the logos you have selected and their current share price. You have $1,000 virtual dollars to invest in shares. If you buy shares in the logo <strong>that correctly answers the following question</strong>, those shares will be converted to real money (USD)!</p>\r\n\r\n		<div class=\'concept-question\'>Which logo is most likely to capture the attention of Millennials who are starting their careers (primarily ages 18-24)?</div>\r\n\r\n		<form action=\"\">\r\n			<table width=\"100%\" id=\"market\">\r\n				<tr>\r\n					<th class=\'removeFromCart\'></th>\r\n					<th>Concept Name</th>\r\n					<th id=\"priceth\">Current Price</th>\r\n					<th id=\"ati\" colspan=\"2\" >Amount to Invest</th>\r\n					<th id=\"pic\">Payout if Correct</th>\r\n				</tr>\r\n				<%\r\n					concepts.each(function(concept, idx){\r\n				%>\r\n					<tr class=\'<%= (idx % 2 == 0) ? \"even\" : \"odd\" %> concept\' id=\"concept_<%= idx %>\" data-id=\"<%= concept.get(\'id\') %>\">\r\n						<td class=\'removeFromCart\'><a href=\"#removeFromCart\" class=\"remove\"></a></td>\r\n						<td class=\"conceptName\" data-id=\"<%= concept.get(\'id\') %>\">\r\n							<a href=\"#<%= concept.get(\'id\') %>\" class=\"inline\"><%= concept.get(\'name\') %></a>\r\n						</td>\r\n						<td class=\'price\'>$<%= concept.get(\'marketPrice\') %></td>\r\n						<td class=\"atislider\">\r\n							<input type=\"range\" class=\"stock_selection\" id=\"stock_<%= idx %>\" value=\'0\' min=\'0\' max=\'1000\' step=\"1\">\r\n						</td>\r\n						<td class=\"amountToInvest\">$<input class=\"ati\" type=\"text\" value=\"0\"></td>\r\n\r\n						<td class=\'payout\'>$0.00</td>\r\n					</tr>\r\n				<% }); %>\r\n			</table>\r\n		</form>\r\n\r\n		<div id=\"balanceWrapper\">\r\n			Remaining Balance: <span id=\"remainingBalance\">$1000.00</span>\r\n		</div>\r\n\r\n		<div id=\"buyFooter\">\r\n			<a href=\"#concept/0\" class=\"styledButton reset\">Reset</a>\r\n			<a href=\"\" class=\"styledButton purchase navNextButton\">Purchase</a>\r\n		</div>\r\n		\r\n		<div class=\"popups hidden\">\r\n			<% concepts.each(function(concept, idx){ %>\r\n				<div id=\"<%= concept.get(\'id\') %>\">\r\n					<h4><%= concept.get(\'name\') %></h4>\r\n					<p><%= concept.get(\'thumb_html\') %></p>\r\n				</div>\r\n			<% }); %>\r\n		</div>\r\n</div>','2013-12-03 16:31:25','2013-12-04 18:31:03'),
	(24,4,'best_concept','','default','<a href=\"\" class=\"next navNextButton\"><img src=\"http://intengoresearch.com/img/next.png\" alt=\"next\"></a>\r\n\r\n<div class=\"wrapper\" id=\"best_concept\">\r\n	<h1 id=\"notietitle\">Best Logo</h1>\r\n	<h1 id=\"tietitle\" style=\"display:none;\">Best Concept Tie</h1>\r\n	<section id=\"tie\">\r\n		<p>If we were to offer you 10 additional shares in <strong>one</strong> of the following concepts, which would you choose?</p>\r\n		<div id=\"concepts\"></div>\r\n	</section>\r\n\r\n	<section id=\"winner\">\r\n		<div id=\"concept\"></div>\r\n		<div id=\"questions\"></div>\r\n	</section>\r\n	</div>','2013-12-03 16:31:25','2013-12-03 19:37:00'),
	(25,4,'worst_concept','','default','<a href=\"#best_concept\" class=\"prev\"><img src=\"http://intengoresearch.com/img/prev.png\" alt=\"back\"></a>\r\n\r\n	\r\n<a href=\"\" class=\"next navNextButton\"><img src=\"http://intengoresearch.com/img/next.png\" alt=\"next\"></a>\r\n<div class=\"wrapper\" id=\"worst_concept\">\r\n	<h1 id=\"notietitle\">Worst Logo</h1>\r\n	<h1 id=\"tietitle\" style=\"display:none;\">Worst Concept Tie</h1>\r\n	<section id=\"tie\">\r\n		<p>Let\'s replace the text on #worst_concept with this: \"Which of these logos is <strong>LEAST LIKELY</strong> to capture the attention of Millennials who are looking for work or just starting out their careers (primarily ages 18-24)?</p>\r\n		<div id=\"concepts\"></div>\r\n	</section>\r\n\r\n	<section id=\"winner\" class=\"result\">\r\n		<div id=\"concept\"></div>\r\n		<div id=\"questions\"></div>\r\n	</section>\r\n	</div>','2013-12-03 16:31:25','2013-12-05 16:27:40'),
	(26,4,'suggestions','','default','<a href=\"#worst_concept\" class=\"prev\"><img src=\"http://intengoresearch.com/img/prev.png\" alt=\"back\"></a>\r\n\r\n	\r\n<a href=\"\" class=\"next navNextButton\"><img src=\"http://intengoresearch.com/img/next.png\" alt=\"next\"></a>\r\n<div class=\"wrapper\" id=\"suggestions\">\r\n	<h1>Help Improve This Logo!</h1>\r\n	<section>\r\n		<div id=\"concepts\"></div>\r\n		<div id=\"votes\">\r\n			<p style=\"margin-top:0px;\">\r\n				Here are some suggestions for improving this product. Use the \"thumbs up\" or \"thumbs down\" buttons to indicate if you agree with the suggestion. You can also add a suggestion of your own using the space provided at the bottom.</p>\r\n\r\n<b>If you could change one thing about this logo to make it more appealing to Millennials, what would that be?</b>\r\n\r\n			<div id=\"suggestions_wrapper\"></div>\r\n\r\n		</div>\r\n	</section>\r\n	</div>','2013-12-03 16:31:25','2013-12-03 19:43:23'),
	(27,4,'demographics',NULL,'default','<a href=\"#suggestions\" class=\"prev\"><img src=\"http://intengoresearch.com/img/prev.png\" alt=\"back\"></a>\r\n\r\n	\r\n<a href=\"\"  class=\"next navNextButton\"><img src=\"http://intengoresearch.com/img/next.png\" alt=\"next\"></a>\r\n\r\n<div class=\"wrapper\" id=\"demographics\">\n	<h1>Tell us a little about yourself.</h1>\r\n\r\n	<section>\r\n		<p></p>\r\n		<ul id=\"questions\"></ul>\r\n	</section>\r\n	</div>','2013-12-03 16:31:25','2013-12-03 16:31:25'),
	(28,4,'finish','','default','<div class=\"wrapper\" id=\"finish\">\r\n<h1>Thank You!</h1><p>Your thoughts are very valuable as this organization pursues a visual identity. Thank you so much for participating in the process!</p><p>Your confirmation code is: <b>INTLOGO127</b></p><p>Please submit this code in Mturk to receive credit for this HIT.</p>\r\n</div>','2013-12-03 16:31:25','2013-12-05 19:30:30'),
	(29,4,'buy_fail',NULL,'optional','<div class=\"wrapper\" id=\"buy_fail\">\n	<h1>Uh oh!</h1>\r\n	<p>You must add at least one concept to your portfolio. Please click the button below to try again.</p>\r\n\r\n	<div id=\"centerButtons\">\r\n			<a href=\"#concept/0\" class=\"styledButton reset\">Try Again</a>\r\n	</div>\r\n	</div>','2013-12-03 16:31:25','2013-12-03 16:31:25'),
	(30,4,'category_fail','','optional','<div class=\"wrapper\" id=\"category_fail\">\r\n     <h1>Thanks for your interest</h1><p>Unfortunately, you do not qualify for today\'s HIT. Keep your eyes open for more interesting opportunities from Intengo in the future.</p>\r\n</div>','2013-12-03 16:31:25','2013-12-05 19:21:30'),
	(31,4,'thank_you_fail','','optional','<div class=\"wrapper\" id=\"thank_you_fail\">\r\n<h1>Thanks for your interest</h1><p>Unfortunately, you must agree to the terms of our NDA in order to qualify for todays HIT. Keep your eyes open for more interesting opportunities from Intengo in the future.</p>\r\n </div>','2013-12-03 16:31:25','2013-12-05 19:23:46'),
	(32,4,'quota_met',NULL,'optional','<div class=\"wrapper\" id=\"quota_met\">\n	<h1>Uh oh!</h1>\r\n	<p>This survey has already been completed by the maximum number of participants. Thank you for your interest!</p>\r\n\r\n\r\n	</div>','2013-12-03 16:31:25','2013-12-03 16:31:25'),
	(33,4,'mechanicalturk','#mt','default','<div class=\"wrapper\" id=\"\">\r\n<h1 id=\"mturkid\">MTurk ID</h1>\r\n\r\n<p>Before we begin, please enter your Mechanical Turk worker ID.</p>\r\n\r\n<form action=\"#\" id=\"mtid\">\r\n<input type=\"text\" placeholder=\"Mechanical Turk ID\">\r\n<input type=\"submit\" value=\"proceed\">\r\n</form>\r\n</div>\r\n\r\n<script type=\"text/javascript\">\r\n$(\'#mtid\').on(\'submit\', function(e){\r\n    e.preventDefault();\r\n    var id = $(this).find(\'input[type=\"text\"]\').val()\r\n    $.ajax({\r\n          url: \'/users/data\',\r\n          type: \'POST\',\r\n          data: { \"mtid\": id }\r\n    }).done(function(){\r\n       window.location.hash = \'intro\';\r\n    });\r\n});\r\n</script>','2013-12-05 16:47:12','2013-12-05 19:18:40'),
	(35,4,'followup','','default','<div class=\"wrapper\" id=\"\">\n<a href=\"#suggestions\" class=\"prev\"><img src=\"http://intengoresearch.com/img/prev.png\" alt=\"back\"></a>\r\n\r\n	<div class=\"wrapper\" id=\"followup\">\r\n		<h1>Follow Up</h1>\r\n\r\n		<div id=\"questions\"></div>\r\n\r\n<div id=\"centerButtons\">\r\n	<a id=\"saveQuestions\" href=\"finish\" class=\"styledButton navNextButton\">Finish</a>\r\n</div>\r\n	</div></div>','2013-12-18 21:35:57','2013-12-18 21:35:57'),
	(36,5,'intro','','default','<div class=\"wrapper\" id=\"intro\">\r\n	<div id=\"translations\">\r\n		<a href=\"language/en\">English</a> | <a href=\"language/es\">Spanish</a>\r\n	</div><!-- #translations -->\r\n	<h1 class=\"tagline\">Get Paid for Having FUN!!</h1>\r\n	<p>We\'d like your help today by participating in a stock investing game. In this game we\'ll present you with several new design concepts. Once you\'ve reviewed each concept, you\'ll be given the opportunity to buy shares in them using a stock trading tool. Dont worry, we wont ask for your money! Were giving you $1,000 virtual dollars to invest.</p>\r\n	<p>This exercise represents a new way for you to help companies predict which designs will intrigue people and which will make no impact. In addition to the reward you\'ll be receiving for participating, by investing in the correct concept, you\'ll be able to win up to an additional $10!</p>\r\n	<h2 id=\"intro\"></h2>\r\n\r\n\r\n	<div id=\"centerButtons\">\r\n		<a href=\"\" class=\"styledButton navNextButton\">Let\'s Get Started!</a>\r\n	</div>\r\n</div>','2013-12-03 16:31:24','2013-12-03 22:18:55'),
	(37,5,'categories','','default','<a href=\"#intro\" class=\"prev\"><img src=\"http://intengoresearch.com/img/prev.png\" alt=\"back\"></a>\r\n\r\n<div class=\"wrapper\" id=\"\">\r\n	<h1>Who Do You Know?</h1>\r\n	<p>For this exercise, youll need to get inside the mind of a specific type of person.  Youll need to understand this persons motivations, preferences, and attitudes in order to make the best prediction.  And remember, youll only earn a bonus by choosing the correct concept, so only choose the three (3) types of people you are most familiar with:</p>\r\n\r\n	<ul id=\"screenerCategories\" class=\"clearfix\">\r\n	<% _.each(display_categories, function(cat, i) { %>\r\n		<li><input class=\"category_button\" type=\"checkbox\" id=\"<%= cat.id %>\" name=\"<%= cat.name %>\" value=\"<%= cat.id %>\">\r\n			<label for=\"<%= cat.id %>\"><%= cat.name %></label>\r\n		</li>\r\n	<% }); %>\r\n	</ul>\r\n	<div id=\"centerButtons\">\r\n		<a id=\"checkCategories\" href=\"\" class=\"styledButton navNextButton\">Continue</a>\r\n	</div>\r\n</div>','2013-12-03 16:31:25','2013-12-03 16:53:57'),
	(38,5,'agreement','','default','<a href=\"#categories\" class=\"prev\"><img src=\"http://intengoresearch.com/img/prev.png\" alt=\"back\"></a>\r\n\r\n<div id=\"nda\" align=\"center\">\r\n	<table border=\"0\" align=\"center\" width=\"1015px\" cellpadding=\"0\" cellspacing=\"0\">\r\n	<tbody><tr>\r\n	<td border=\"0\" height=\"11px\"><img src=\"https://surveys.infosurv.com/vovici/images/iCE/theme_01.gif\" border=\"0\"></td>\r\n	</tr>\r\n	<tr>\r\n	<td background=\"https://surveys.infosurv.com/vovici/images/iCE/theme_03.gif\">\r\n	<div style=\"position:relative;margin-left:10px;padding-left:3px;padding-right:2px;width:980px;\">\r\n\r\n	          <h1>Intengo</h1>\r\n	<div style=\"font-weight:bold;font-size:1.7em;color:gray;\">Agreement</div>\r\n		<p>This Agreement (the \"Agreement\") is made and entered into by and between Infosurv, Inc. d/b/a Intengo, a Delaware corporation (hereinafter \"Intengo\"), and a participant (hereinafter \"RESPONDENT\") in an online internet study (\"the Study\") being conducted by Intengo (collectively, the \"Parties\").</p>\r\n		<p><strong>WHEREAS</strong>, Intengo desires to share certain confidential information with the RESPONDENT in connection with the Study;</p>\r\n		<p><strong>WHEREAS</strong>, RESPONDENT desires to provide Intengo certain non-confidential information in connection with the Study;</p>\r\n		<p><strong>NOW THEREFORE</strong>, for and in consideration of the foregoing and the mutual promises and covenants contained herein, the Parties agree as follows:</p>\r\n\r\n		<strong>1. DEFINITIONS</strong>\r\n		<ul>\r\n			<li>1.1. \"Confidential Information\" shall mean all non-public information that Intengo provides to RESPONDENT. \"Confidential Information\" shall include, but not be limited to, any images, ideas, descriptions, or media related to the concepts found within the Study.</li>\r\n			<li>1.2. Confidential Information shall not include that information included within the definition of Confidential Information above which:</li>\r\n				<ul>\r\n					<li>1.2a entered the public domain without RESPONDENT\'s breach of any obligation owed Intengo, or</li>\r\n					<li>1.2b became known to RESPONDENT prior to Intengo\'s disclosure of such information to RESPONDENT, or</li>\r\n					<li>1.2c became known to RESPONDENT from a source other than Intengo other than by the breach of an obligation of confidentiality owed to Intengo, or</li>\r\n					<li>1.2d was independently developed by RESPONDENT.</li>\r\n				</ul>\r\n\r\n			<li>RESPONDENT must establish that information falls into categories 1.2a, 1.2b, 1.2c, or 1.2d with contemporaneous documentary evidence.</li>\r\n			<li>1.3. \"Confidential Materials\" shall mean all tangible materials in any media containing Confidential Information, including without limitation, written or printed documents, product samples, software, machines, prototypes, designs, specifications, articles of manufacture, drawings, and computer disks or tapes, whether machine-readable or user-readable.</li>\r\n		</ul>\r\n\r\n		<strong>2. RESTRICTIONS</strong>\r\n		<ul>\r\n			<li>2.1. RESPONDENT agrees that it will not use the Confidential Information or Confidential Materials for any purpose whatsoever except as necessary for the performance of its duties in connection with the Study.</li>\r\n			<li>2.2. RESPONDENT shall take all reasonable steps necessary to preserve the confidentiality of the Confidential Information and Confidential Materials and to prevent such Confidential Information and Confidential Materials from falling into the public domain or into the possession of other persons, including without limitation those steps that RESPONDENT takes to protect the confidentiality of its own confidential information.</li>\r\n			<li>2.3. RESPONDENT shall not (i) disclose any Confidential Information to any person, or (ii) use the Confidential Information or Confidential Materials for any reason or purpose other than to evaluate said Confidential Materials within the Study.</li>\r\n			<li>2.4. RESPONDENT may not reverse engineer, recreate, reconstruct, deconstruct, decompile, disassemble, or analyze any Confidential Materials or any substantial part thereof, nor create derivative works similar to any Confidential Materials without the express written permission of Intengo. RESPONDENT acknowledges its obligation to control access to technical data under the U.S. Export Laws and Regulations and agrees to adhere to such laws and regulations with regard to any technical data received under this Agreement.</li>\r\n			<li>2.5. RESPONDENT may disclose Confidential Information as required by government or judicial order, provided RESPONDENT gives Intengo prompt notice of such order and complies with any protective order (or equivalent) imposed on such disclosure.</li>\r\n			<li>2.6. RESPONDENT agrees that any and all information provided by RESPONDENT to Intengo in connection with the Study shall be considered non-confidential information by both Parties and such information may be used and/or disclosed by Intengo without restriction.  In addition, both Parties agree that Intengo may transfer any of its rights to use and disclose such information to any third party. Notwithstanding the foregoing, Intengo agrees that it shall not disclose the RESPONDENTS name or residence address to any third party.  RESPONDENT further agrees that all title, ownership rights, and other intellectual and proprietary rights in any an idea or concept embodied in the information provided by RESPONDENT to Intengo shall be the property of Intengo.  If necessary RESPONDENT agrees that it will sign all paperwork required to transfer all title, ownership rights, and other intellectual and proprietary rights in any such idea or concept to Intengo.</li>\r\n		</ul>\r\n\r\n		<strong>3. RIGHTS AND REMEDIES</strong>\r\n		<ul>\r\n			<li>3.1. RESPONDENT shall notify Intengo promptly upon discovery of any unauthorized use or disclosure of Confidential Information or Confidential Materials, or any other breach of this Agreement by RESPONDENT, and will cooperate with Intengo in every reasonable way to help Intengo regain possession of the Confidential Information or Confidential Materials and prevent its future unauthorized use.</li>\r\n			<li>3.2. RESPONDENT shall return all originals, copies, reproductions, and summaries of Confidential Information and Confidential Materials at Intengo\'s request or, at Intengo\'s option, certify destruction of the same.</li>\r\n			<li>3.3. RESPONDENT acknowledges that monetary damages may not be a sufficient remedy for unauthorized disclosure or use of Confidential Information or Confidential Materials and that Intengo shall be entitle to, without waiving any other rights or remedies, such injunctive or equitable relief as may deemed proper by a court of competent jurisdiction.</li>\r\n		</ul>\r\n\r\n		<strong>4. MISCELLANEOUS</strong>\r\n		<ul>\r\n			<li>4.1. All Confidential Information and Confidential Materials are and shall remain the property of Intengo. By disclosing information to RESPONDENT, Intengo does not grant any express or implied right or license to RESPONDENT to use the Confidential Information and Confidential Materials or to any of Intengo\'s patents, copyrights, trademarks, trade secret information or other intellectual property.</li>\r\n			<li>4.2. This Agreement constitutes the entire agreement between the Parties with respect to the subject matter hereof and merges all prior discussions between them regarding the Confidential Information and Confidential Materials. This Agreement shall not be modified except by a written agreement dated subsequent to the date of this Agreement and signed by both Parties. None of the provisions of this Agreement shall be deemed to have been waived by any act or acquiescence on the part of Intengo, its agents, or employees, but only by an instrument in writing signed by an authorized officer of Intengo. No waiver of any provision of this Agreement shall constitute a waiver of any other provision(s) or of the same provision on another occasion.</li>\r\n			<li>4.3. If Intengo employs attorneys to enforce any rights arising out of or in relation to this Agreement, and prevails in such matter, Intengo shall be entitled to recover reasonable attorney\'s fees. This Agreement shall be construed and controlled by the laws of the State of Georgia, and both Parties consent to jurisdiction by the state and federal courts sitting in the State of Georgia. Process may be served on either party by U.S. Mail, postage prepaid, certified or registered, return receipt requested. If any provision of this Agreement shall be held by a court of competent jurisdiction to be illegal, invalid or unenforceable, the remaining provisions shall remain in full force and effect.</li>\r\n			<li>4.4. This Agreement will inure to the benefit of and be binding upon the Parties, their successors and assigns. All obligations created by this Agreement shall survive termination of the Parties\' business relationship.</li>\r\n		</ul>\r\n\r\n	<br>\r\n	<table cellspacing=\"0\" cellpadding=\"0\" width=\"900\" border=\"0\" class=\"copyright-text\">\r\n	<tbody>\r\n	<tr>\r\n	<td align=\"left\" width=\"33%\"></td>\r\n	<td align=\"center\" width=\"33%\"><span class=\"copyright-text\"><font color=\"#777777\"> 2013 Intengo. (Infosurv, Inc. d/b/a Intengo). All rights reserved.</font></span></td>\r\n	<td align=\"right\" width=\"34%\"></td></tr></tbody></table>\r\n	</div>\r\n	</td></tr>\r\n	<tr>\r\n	<td><img src=\"https://surveys.infosurv.com/vovici/images/iCE/theme_05.gif\"></td></tr></tbody></table>\r\n</div>\r\n\r\n<div class=\"wrapper\" id=\"\">\r\n	<h1>Agreement</h1>\r\n	<p>A new educational based and career planning company would like your feedback! <strong>Your job is to predict which logo is most likely to capture the attention of Millennials who are looking to find information and career insights on opportunities within a particular industry (primarily ages 18-24)</strong>. If you predict the right one, you can earn up to an additional $10!</p>\r\n\r\n<p>For this scenario you will be reviewing 3 logo concepts. The concepts you are about to review are the confidential intellectual property of our client. In order to proceed, you must agree to the terms of our <a href=\"#nda\" class=\"fancybox\">NDA (non-disclosure agreement)</a>, which specifies how you must treat this confidential information.</p>\r\n\r\n	<ul id=\"agreementPage\">\r\n		<li><a href=\"#thank_you_fail\" class=\"styledButton do-not-agree\">I Do Not Agree</a></li>\r\n		<li><a href=\"\" class=\"styledButton agree navNextButton\">I Agree</a></li>\r\n	</ul>\r\n</div>','2013-12-03 16:31:25','2013-12-03 17:06:26'),
	(39,5,'background','','default','<a href=\"#agreement\" class=\"prev\"><img src=\"http://intengoresearch.com/img/prev.png\" alt=\"back\"></a>\r\n\r\n<div class=\"wrapper\" id=\"\">\r\n	<h1>Background</h1>\r\n	<p>Before we show you the logo concepts, we want to tell you a bit about what this company stands for and the type of \r\n	person they are trying to attract.</p>\r\n\r\n	<h4 class=\"underline\">The Challenge</h4>\r\n	<p>We have been asked to select a logo for a business that wants to launch a targeted service offering that aspires to become the go-to resource for insights, career pathing, and general education on opportunities in the insurance industry.  The logo should be exciting and inviting  to motivate people to want to be a part of the insurance industry.</p>\r\n\r\n	<h4 class=\"underline\">Who We Want to Attract</h4>\r\n	<p>The logo should most importantly capture the attention of Millennials who are starting out their careers (primarily ages 18-24).  It should inspire them to want to learn more about potential opportunities available within the insurance field, how their interests and skills could translate to various positions/roles, and to change their perception of the industry overall in a favorable way.</p>\r\n\r\n	<p>Remember, Millennials are tech savvy and entrepreneurial.  They are well-educated, diverse, non-conformists, confident and accepting.  With social media ever-present, they are well-connected.  They believe that hard work should feel good, meaning they believe in it.  And they are self-advocates, believing they can have what they want if they work hard.</p>\r\n\r\n	<p>You should only invest in logos that will intrigue these people.</p>\r\n\r\n	<div id=\"centerButtons\">\r\n		<a href=\"\" class=\"styledButton navNextButton\">Continue</a>\r\n	</div>\r\n</div>','2013-12-03 16:31:25','2013-12-04 15:54:41'),
	(40,5,'instructions','','default','<a href=\"#instructions\" class=\"prev\"><img src=\"http://intengoresearch.com/img/prev.png\" alt=\"back\"></a>\r\n\r\n	<div class=\"wrapper\" id=\"instructions\">\r\n		<h1>Instructions</h1>\r\n		<p>\r\n			Now, thinking about what this company stands for, and the people they plan to serve, were going to show you a few potential logo concepts for the company. As you make your predictions regarding the strongest concept(s), think carefully about the companys purpose, and the personality of the people theyd like to attract.</p>\r\n\r\n<p>To make your predictions, youll be asked to invest $1,000 virtual dollars among the available concepts. Think of it as making a bet or investing in the stock market.</p>\r\n\r\n<p>On the next page, were going to show you the first concept. If you think youd like to buy shares in this concept, just click Add to Portfolio. If you dont think the concept will be successful, just click No Thanks.</p>\r\n\r\n<p>Once youve chosen all of the concepts youd like to buy shares in, well tell you the cost of each concepts shares and then let you decide how youd like to invest. You can always remove concepts from your portfolio if you decide not to purchase shares.</p>\r\n\r\n		<div id=\"centerButtons\">\r\n			<a href=\"\" class=\"styledButton navNextButton\">SHOW ME THE LOGOS</a>\r\n		</div>\r\n	</div>','2013-12-03 16:31:25','2014-01-09 22:19:06'),
	(41,5,'concept',NULL,'default','<a href=\"#instructions\" class=\"prev\"><img src=\"http://intengoresearch.com/img/prev.png\" alt=\"back\"></a>\r\n\r\n	<div class=\"wrapper\" id=\"conceptsPage\">\n		<h1><%= this.model.get(\'name\') %></h1>\r\n\r\n		<div id=\"conceptHTML\">\r\n			<%= this.model.get(\'html\') %>\r\n\r\n			<div id=\"portfolioButtons\">\r\n				<div style=\"display:inline;margin:0px 10px;\">\r\n					<a href=\"#next\" data-concept_id=\"<%= this.model.get(\'id\') %>\" class=\"styledButton reject\">No Thanks</a>\r\n				</div>\r\n\r\n				<div style=\"display:inline;margin:0px 10px;\">\r\n					<a href=\"#next\" class=\"styledButton add\" data-concept_id=\"<%= this.model.get(\'id\') %>\">Add To Portfolio</a>\r\n				</div>\r\n			</div>\r\n		</div>\r\n	</div>','2013-12-03 16:31:25','2013-12-03 16:31:25'),
	(42,5,'buy','','default','<div class=\"wrapper\" id=\"buy\">\r\n		<h1>Your Logos</h1>\r\n		<p>Alright, it\'s time to check out. Below, you\'ll see the logos you have selected and their current share price. You have $1,000 virtual dollars to invest in shares. If you buy shares in the logo <strong>that correctly answers the following question</strong>, those shares will be converted to real money (USD)!</p>\r\n\r\n		<div class=\'concept-question\'>Which logo is most likely to capture the attention of Millennials who are starting their careers (primarily ages 18-24)?</div>\r\n\r\n		<form action=\"\">\r\n			<table width=\"100%\" id=\"market\">\r\n				<tr>\r\n					<th class=\'removeFromCart\'></th>\r\n					<th>Concept Name</th>\r\n					<th id=\"priceth\">Current Price</th>\r\n					<th id=\"ati\" colspan=\"2\" >Amount to Invest</th>\r\n					<th id=\"pic\">Payout if Correct</th>\r\n				</tr>\r\n				<%\r\n					concepts.each(function(concept, idx){\r\n				%>\r\n					<tr class=\'<%= (idx % 2 == 0) ? \"even\" : \"odd\" %> concept\' id=\"concept_<%= idx %>\" data-id=\"<%= concept.get(\'id\') %>\">\r\n						<td class=\'removeFromCart\'><a href=\"#removeFromCart\" class=\"remove\"></a></td>\r\n						<td class=\"conceptName\" data-id=\"<%= concept.get(\'id\') %>\">\r\n							<a href=\"#<%= concept.get(\'id\') %>\" class=\"inline\"><%= concept.get(\'name\') %></a>\r\n                                                        <a href=\"#<%= concept.get(\'id\') %>\" class=\"inline glass\">Glass</a>\r\n						</td>\r\n						<td class=\'price\'>$<%= concept.get(\'marketPrice\') %></td>\r\n						<td class=\"atislider\">\r\n							<input type=\"range\" class=\"stock_selection\" id=\"stock_<%= idx %>\" value=\'0\' min=\'0\' max=\'1000\' step=\"1\">\r\n						</td>\r\n						<td class=\"amountToInvest\">$<input class=\"ati\" type=\"text\" value=\"0\"></td>\r\n\r\n						<td class=\'payout\'>$0.00</td>\r\n					</tr>\r\n				<% }); %>\r\n			</table>\r\n		</form>\r\n\r\n		<div id=\"balanceWrapper\">\r\n			Remaining Balance: <span id=\"remainingBalance\">$1000.00</span>\r\n		</div>\r\n\r\n		<div id=\"buyFooter\">\r\n			<a href=\"#concept/0\" class=\"styledButton reset\">Reset</a>\r\n			<a href=\"\" class=\"styledButton purchase navNextButton\">Purchase</a>\r\n		</div>\r\n		\r\n		<div class=\"popups hidden\">\r\n			<% concepts.each(function(concept, idx){ %>\r\n				<div id=\"<%= concept.get(\'id\') %>\">\r\n					<h4><%= concept.get(\'name\') %></h4>\r\n					<p><%= concept.get(\'thumb_html\') %></p>\r\n				</div>\r\n			<% }); %>\r\n		</div>\r\n</div>','2013-12-03 16:31:25','2014-01-10 22:09:05'),
	(43,5,'best_concept','','default','<a href=\"\" class=\"next navNextButton\"><img src=\"http://intengoresearch.com/img/next.png\" alt=\"next\"></a>\r\n\r\n<div class=\"wrapper\" id=\"best_concept\">\r\n	<h1 id=\"notietitle\">Best Logo</h1>\r\n	<h1 id=\"tietitle\" style=\"display:none;\">Best Concept Tie</h1>\r\n	<section id=\"tie\">\r\n		<p>If we were to offer you 10 additional shares in <strong>one</strong> of the following concepts, which would you choose?</p>\r\n		<div id=\"concepts\"></div>\r\n	</section>\r\n\r\n	<section id=\"winner\">\r\n		<div id=\"concept\"></div>\r\n		<div id=\"questions\"></div>\r\n	</section>\r\n	</div>','2013-12-03 16:31:25','2013-12-03 19:37:00'),
	(44,5,'worst_concept','','default','<a href=\"#best_concept\" class=\"prev\"><img src=\"http://intengoresearch.com/img/prev.png\" alt=\"back\"></a>\r\n\r\n	\r\n<a href=\"\" class=\"next navNextButton\"><img src=\"http://intengoresearch.com/img/next.png\" alt=\"next\"></a>\r\n<div class=\"wrapper\" id=\"worst_concept\">\r\n	<h1 id=\"notietitle\">Worst Logo</h1>\r\n	<h1 id=\"tietitle\" style=\"display:none;\">Worst Concept Tie</h1>\r\n	<section id=\"tie\">\r\n		<p>Why do you feel this logo is <strong>LEAST LIKELY</strong> to capture the attention of Millennials? Please cite specific connotations, imagery, associations, etc. that influenced your decision. </p>\r\n		<div id=\"concepts\"></div>\r\n	</section>\r\n\r\n	<section id=\"winner\" class=\"result\">\r\n		<div id=\"concept\"></div>\r\n		<div id=\"questions\"></div>\r\n	</section>\r\n	</div>','2013-12-03 16:31:25','2014-01-10 21:57:57'),
	(45,5,'suggestions','','default','<a href=\"#worst_concept\" class=\"prev\"><img src=\"http://intengoresearch.com/img/prev.png\" alt=\"back\"></a>\r\n\r\n	\r\n<a href=\"\" class=\"next navNextButton\"><img src=\"http://intengoresearch.com/img/next.png\" alt=\"next\"></a>\r\n<div class=\"wrapper\" id=\"suggestions\">\r\n	<h1>Help Improve This Logo!</h1>\r\n	<section>\r\n		<div id=\"concepts\"></div>\r\n		<div id=\"votes\">			\r\n<p><strong>If you could change one thing about this logo to make it more appealing to Millennials, what would that be?</strong></p>\r\n<p><em>Please add your own idea and also vote on ideas other participants have submitted.</em></p>\r\n			<div id=\"suggestions_wrapper\"></div>\r\n\r\n		</div>\r\n	</section>\r\n	</div>','2013-12-03 16:31:25','2014-01-09 22:28:00'),
	(46,5,'demographics',NULL,'default','<a href=\"#suggestions\" class=\"prev\"><img src=\"http://intengoresearch.com/img/prev.png\" alt=\"back\"></a>\r\n\r\n	\r\n<a href=\"\"  class=\"next navNextButton\"><img src=\"http://intengoresearch.com/img/next.png\" alt=\"next\"></a>\r\n\r\n<div class=\"wrapper\" id=\"demographics\">\n	<h1>Tell us a little about yourself.</h1>\r\n\r\n	<section>\r\n		<p></p>\r\n		<ul id=\"questions\"></ul>\r\n	</section>\r\n	</div>','2013-12-03 16:31:25','2013-12-03 16:31:25'),
	(47,5,'finish','','default','<div class=\"wrapper\" id=\"finish\">\r\n<h1>Thank You!</h1><p>Your thoughts are very valuable as this organization pursues a visual identity. Thank you so much for participating in the process!</p><p>Your confirmation code is: <b>INTLOGO127</b></p><p>Please submit this code in Mturk to receive credit for this HIT.</p>\r\n</div>','2013-12-03 16:31:25','2013-12-05 19:30:30'),
	(48,5,'buy_fail',NULL,'optional','<div class=\"wrapper\" id=\"buy_fail\">\n	<h1>Uh oh!</h1>\r\n	<p>You must add at least one concept to your portfolio. Please click the button below to try again.</p>\r\n\r\n	<div id=\"centerButtons\">\r\n			<a href=\"#concept/0\" class=\"styledButton reset\">Try Again</a>\r\n	</div>\r\n	</div>','2013-12-03 16:31:25','2013-12-03 16:31:25'),
	(49,5,'category_fail','','optional','<div class=\"wrapper\" id=\"category_fail\">\r\n     <h1>Thanks for your interest</h1><p>Unfortunately, you do not qualify for today\'s HIT. Keep your eyes open for more interesting opportunities from Intengo in the future.</p>\r\n</div>','2013-12-03 16:31:25','2013-12-05 19:21:30'),
	(50,5,'thank_you_fail','','optional','<div class=\"wrapper\" id=\"thank_you_fail\">\r\n<h1>Thanks for your interest</h1><p>Unfortunately, you must agree to the terms of our NDA in order to qualify for todays HIT. Keep your eyes open for more interesting opportunities from Intengo in the future.</p>\r\n </div>','2013-12-03 16:31:25','2013-12-05 19:23:46'),
	(51,5,'quota_met',NULL,'optional','<div class=\"wrapper\" id=\"quota_met\">\n	<h1>Uh oh!</h1>\r\n	<p>This survey has already been completed by the maximum number of participants. Thank you for your interest!</p>\r\n\r\n\r\n	</div>','2013-12-03 16:31:25','2013-12-03 16:31:25'),
	(52,5,'mechanicalturk','#mt','default','<div class=\"wrapper\" id=\"\">\r\n<h1 id=\"mturkid\">MTurk ID</h1>\r\n\r\n<p>Before we begin, please enter your Mechanical Turk worker ID.</p>\r\n\r\n<form action=\"#\" id=\"mtid\">\r\n<input type=\"text\" placeholder=\"Mechanical Turk ID\">\r\n<input type=\"submit\" value=\"proceed\">\r\n</form>\r\n</div>\r\n\r\n<script type=\"text/javascript\">\r\n$(\'#mtid\').on(\'submit\', function(e){\r\n    e.preventDefault();\r\n    var id = $(this).find(\'input[type=\"text\"]\').val()\r\n    $.ajax({\r\n          url: \'/users/data\',\r\n          type: \'POST\',\r\n          data: { \"mtid\": id }\r\n    }).done(function(){\r\n       window.location.hash = \'intro\';\r\n    });\r\n});\r\n</script>','2013-12-05 16:47:12','2013-12-05 19:18:40'),
	(53,5,'followup','','default','<a href=\"#suggestions\" class=\"prev\"><img src=\"http://intengoresearch.com/img/prev.png\" alt=\"back\"></a>\r\n\r\n	<div class=\"wrapper\" id=\"followup\">\r\n		<h1>About This Exercise</h1>\r\n\r\n		<div id=\"questions\"></div>\r\n\r\n<div id=\"centerButtons\">\r\n	<a id=\"saveQuestions\" href=\"followup2\" class=\"styledButton navNextButton\">Next</a>\r\n</div>\r\n	</div>','2013-12-18 21:35:57','2014-01-09 22:37:45'),
