	(164,13,'intro','','default','<div class=\"wrapper\" id=\"\">\r\n<h1 id=\"mturkid\">MTurk ID</h1>\r\n\r\n<p>Before we begin, please enter your Mechanical Turk worker ID.</p>\r\n\r\n<form action=\"#\" id=\"mtid\">\r\n<input type=\"text\" placeholder=\"Mechanical Turk ID\">\r\n<input type=\"submit\" value=\"proceed\">\r\n</form>\r\n</div>\r\n</div>\r\n\r\n\r\n<script type=\"text/javascript\">\r\n$(\'#mtid\').on(\'submit\', function(e){\r\n    e.preventDefault();\r\n    var id = $(this).find(\'input[type=\"text\"]\').val()\r\n    $.ajax({\r\n          url: \'/users/data\',\r\n          type: \'POST\',\r\n          data: { \"mtid\": id }\r\n    }).done(function(){\r\n       window.location.hash = \'categories\';\r\n    });\r\n});\r\n</script>','2014-01-26 19:47:17','2014-01-27 15:41:04'),
